window.bookSummaryJSON = "<p><b>Girl or game?</b></p> <p>What would you choose?</p> <p>Lando’s romantic evening isn’t going to plan.</p> <p>During it, he’s received exclusive access to a secret update of his favorite virtual reality game. The only problem? He has ten minutes to download it. So now he has to slip away from his hot date and install the new version directly to his neuralink before the offer expires.</p> <p>However, while he’s uploading, the aliens obliterate Earth, and when he wakes, the world has changed.</p> <p>There’s a cultivation system in his mind that’s like he’s online, but not, at the same time. Earth is a wreck, the sky’s turned green, and every animal is out to kill him. Worse, they’re all evolving exponentially and feeding off human survivors.</p> <p>But Lando has an unexpected advantage.</p> <p>The cultivation system implanted inside him hides a powerful AI, and that AI wants to fight back. All Lando has to do is gather a team, rebuild a secret, and go to war.</p> <p><i>The alien invasion is real.</i></p> <p><i>The apocalypse is real.</i></p> <p><i>Will Lando choose to fight?</i></p> <p><i>Damn right he will.</i></p> <p><b>Choose life—choose the game!</b></p> <p><i>This apocalyptic story contains mature content, a cultivation system, monster fights, and rats, lots of rats.</i> Zanamus<i> is an alien invasion LitRPG GameLit novel that contains stats and system progression through core enhancement.</i></p>"; 
